import React from 'react';
const AboutmeIntro = () => (
    <>
        <p>Hi, I’m Stacey. </p>
        <p>I enjoy coding and want to become a software engineer in the future. </p>
        <p>Although I’m still exploring the different areas of software engineering,  I’m currently interested in developing front-end applications the most.</p>
    </>
);

export default AboutmeIntro;
